syntax = "proto3";

package a;

enum One {
  ONE_UNSPECIFIED = 0;
  ONE_ONE = 1;
  ONE_TWO = 2;
}

enum One2 {
  ONE2_UNSPECIFIED = 0;
  ONE2_ONE = 1;
  ONE2_TWO = 2;
}

enum Two2 {
  TWO2_UNSPECIFIED = 0;
  TWO2_ONE = 1;
  TWO2_TWO = 2;
}

message Three2 {
  message Four2 {
    enum Five2 {
      FIVE_UNSPECIFIED = 0;
      FIVE_ONE = 1;
      FIVE_TWO = 2;
    }
    enum Six2 {
      SIX_UNSPECIFIED = 0;
      SIX_ONE = 1;
      SIX_TWO = 2;
    }
  }
  enum Seven2 {
    SEVEN_UNSPECIFIED = 0;
    SEVEN_ONE = 1;
    SEVEN_TWO = 2;
  }
  enum Eight2 {
    EIGHT_UNSPECIFIED = 0;
    EIGHT_ONE = 1;
    EIGHT_TWO = 2;
  }
}

enum Nine {
  reserved "NINE_TWO";

  NINE_UNSPECIFIED = 0;
}
